/**
 * 1368. Minimum Cost to Make at Least One Valid Path in a Grid
 * @param {number[][]} grid
 * @return {number}
 */
class PriorityQueue {
    constructor() { this.queue = [] }

    enqueue(element, priority) {
        this.queue.push({ element, priority })
        this.queue.sort((a, b) => a.priority - b.priority)
    }

    dequeue() { return this.queue.shift().element }

    isEmpty() { return this.queue.length === 0 }
}
var minCost = function(grid) {
    const m = grid.length
    const n = grid[0].length

    // Direction mapping for grid values
    const directions = {
        1: [0, 1],  // Right
        2: [0, -1], // Left
        3: [1, 0],  // Down
        4: [-1, 0]  // Up
    }

    // Priority queue for BFS
    const pq = new PriorityQueue()
    pq.enqueue([0, 0, 0], 0) // [row, col, cost], priority = cost

    // Visited set to avoid revisiting cells
    const visited = Array.from({ length: m }, () => Array(n).fill(false))

    while (!pq.isEmpty()) {
        const [row, col, cost] = pq.dequeue()

        // If already visited, skip
        if (visited[row][col]) { continue }

        // Mark as visited
        visited[row][col] = true

        // If we've reached the bottom-right cell, return the cost
        if (row === m - 1 && col === n - 1) return cost

        // Explore all neighbors
        for (const [sign, [dr, dc]] of Object.entries(directions)) {
            const newRow = row + dr
            const newCol = col + dc

            // Check bounds
            if (newRow >= 0 && newRow < m && newCol >= 0 && newCol < n) {
                const newCost = grid[row][col] == sign ? cost : cost + 1
                pq.enqueue([newRow, newCol, newCost], newCost)
            }
        }
    }
    return -1 // Should not reach here    
};

